import React from "react";
import { useSelector, useDispatch } from "react-redux";
import { Navigate } from "react-router-dom";

function Settings() {
  return (
    <div
      className="d-flex upperture-bg-medium-grey"
      style={{ display: "block", overflow: "auto", minHeight: "100vh" }}
    >
      <h1> Hello world</h1>
    </div>
  );
}

export default Settings;
